import React from 'react';
import reactDOM from 'react-dom';

const App = () =>{
    navigator.geolocation.getCurrentPosition(
        (position) => console.log(position),
        (error) => console.log(error)
    );
    return (
        <div>Hi there!</div>
    );
}


reactDOM.render(<App />, document.querySelector('#root'));
